Spider-Man 2 (2004) 136 min [Spider-Man 2.1 Extended Cut]

DESCRIPTION:
Peter Parker, juggling the delicate balance of his dual life as college student and a superhuman crime fighter, find his life even more complicated when he confronts a new nemesis, the brilliant Otto Octavius who has been reincarnated as the maniacal and multi-tentacled &quot;Doc Ock.&quot; (&quot;Spider-Man 2.1&quot; Extended Cut; with audio commentary from producer Laura Ziskin and screenwriter Alvin Sargent.)

